import React, { useState } from 'react';
import './App.css';
import MenuIcon from '@mui/icons-material/Menu';
import YouTubeIcon from '@mui/icons-material/YouTube';
import SearchIcon from '@mui/icons-material/Search';
import NotificationsIcon from '@mui/icons-material/Notifications';
import AddIcon from '@mui/icons-material/Add';
import { IconButton, InputBase, AppBar, Toolbar, Typography, Box } from '@mui/material';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Home from './Home';

const App = () => {
  const [sidebarOpen, setSidebarOpen] = useState(false);
  const [searchQuery, setSearchQuery] = useState('');

  const toggleSidebar = () => {
    setSidebarOpen(!sidebarOpen);
  };

  const handleSearchChange = (event) => {
    setSearchQuery(event.target.value);
  };

  return (
    <Router>
      <div className="app">
        <AppBar position="static" className="navbar" style={{ backgroundColor: 'black', color: 'white' }}>
          <Toolbar>
            <IconButton edge="start" color="inherit" onClick={toggleSidebar}>
              <MenuIcon />
            </IconButton>
            <Typography variant="h6" noWrap className="logo">
              <YouTubeIcon />
              videoTube
            </Typography>

            <div className="search-bar">
              <InputBase 
                className='searchinput' 
                placeholder="Search" 
                inputProps={{ 'aria-label': 'search' }}
                value={searchQuery}
                onChange={handleSearchChange}
              />
              <SearchIcon className='searchIcon' style={{ width: '50px', border: '2px dotted black' }} />
            </div>

            <Box className="icons">
              <IconButton color="inherit">
                <AddIcon />
              </IconButton>
              <IconButton color="inherit">
                <NotificationsIcon />
              </IconButton>
            </Box>
          </Toolbar>
        </AppBar>

        <div className="main-content">
          <Routes>
            <Route path="/" element={<Home searchQuery={searchQuery} />} />
          </Routes>
        </div>
      </div>
    </Router>
  );
};

export default App;
